Ministro da Agricultura, Pescas e Florestas - 2004/2005;
Secretário de Estado dos Assuntos Europeus - 2002/2004;
Deputado ao Parlamento Europeu - 1994/2002;
Presidente do Conselho de Administração da SATA Air Açores - 1992/1994;
Secretário Regional da Administração Interna do Governo Regional Açores - 1992/1994;
Secretário Regional dos Assuntos Sociais do Governo Regional Açores-1981/1988;
Deputado Assembleia Legislativa dos Açores - 1980/1988;
Director Regional da Segurança Social - 1977/1981

Vice-presidente do Grupo Parlamentar do PSD;
Vice-presidente da Comissão Parlamentar de Assuntos Europeus;
Membro da Comissão Parlamentar de Negócios Estangeiros e Comunidades Portuguesas;
Membro da Comissão Parlamentar de Agricultura, Desenvolvimento Rural e Pescas.

Sócia Fundadora de:
- APAV;
- Liga dos Amigos do Hospital de S. Francisco Xavier;
- Associação Reintegrar;
- Associação de Psicogerontologia;

De Outubro de 1995 a Junho de 2001 - exerceu funções de assessora jurídica no Gabinete do Presidente da Assembleia da República.
Durante este período, suspendeu durante dois meses, as funções referidas para exercer o mandado de Deputada pelo 
pelo Partido Socialista eleita pelo círculo eleitoral de Coimbra;

Membro da Assembleia Municipal do Barreiro (2009-2013)  ;
Membro da Assembleia Metropolitana  de Lisboa (2009-2013)





Membro da Assembleia Municipal do Barreiro

Dirigente Estudantil do Instituto Superior de Ciências do Trabalho e da Empresa;           
Membro da Mesa da Comissão Nacional da Juventude Socialista;
Membro  na Assembleia Municipal do Barreiro;
Vereadora na Camara Municipal do Barreiro;
Técnica Superior do Arquivo Histórico e Biblioteca da Fundação Mário Soares;
